import { Route } from "react-router-dom";
import Welcome from "./components/Welcome";
import Products from "./components/products";

// Route becomes a component that allow us to define a certain path

function App() {
  return (
    <div>
      <Route path="/Welcome">
        <Welcome />
      </Route>
      <Route path="/Products">
        <Products />
      </Route>
    </div>
  );
}

export default App;
